def graf_generator(serie, level):
    url = requests.get(f"http://dataimesc.imesc.ma.gov.br/getData?id={serie}&scope={level}&from=1980&to=2030")
    values=url.json()["values"]
    pandao=pd.DataFrame(values).transpose()
    return pandao

# informações no começo da página
st.title('Gerador de Relatórios')
st.write("Este site usa o banco do DATAIMESC para gerar relatórios que cruzem tanto diferentes indicadores quanto diferentes localidades")
st.header("Parâmetros", divider='blue')
st.write("Insira as opções abaixo e clique no botão para gerar a base")

serie_= st.number_input("Insira o número da série", min_value=0, value=1, step=1)
level_= st.selectbox("Insira a abrangência", (1,2,3,4))
if level_ == 1:
   opcoes = ['BR']
elif level_ == 2:
   opcoes = ['N','NE','SE','S','CO']
elif level_ == 3:
   opcoes = ['RO','SP','AC',"AM","RR","PA","AP","TO","MA","PI","CE","RN","PB","PE","AL","SE","BA","MG","ES","RJ","PR","SC","MT","GO","DF"]
elif level_ == 4:
   opcoes = ['211000']

localidade = st.multiselect("Insira o código do local (pode ser mais de um)", options=opcoes)

expor = graf_generator(serie_,level_)

st.dataframe(expor)

def converte_data_csv(data):
   return data.to_csv().encode('utf-8')
dados_csv = converte_data_csv(expor)

